// src/world/aux/TiltAuxiliary.ts
class TiltAuxiliary extends ControlledLooper {
  constructor({ controls, tilt, motor }) {
    super(motor, controls, ({ up, down }) => up || down, { controls, tilt });
  }
  refresh({ data: { controls, tilt }, deltaTime, motor, refresher }) {
    const { up, down } = controls;
    const turnspeed = deltaTime / 400;
    if (up) {
      tilt.angle.addValue(-turnspeed);
    }
    if (down) {
      tilt.angle.addValue(turnspeed);
    }
    if (!up && !down) {
      motor.stopUpdate(refresher);
    }
  }
}

// src/world/aux/SmoothFollowAuxiliary.ts
class SmoothFollowAuxiliary extends E2 {
  followee;
  listener = () => this.start();
  constructor({ followee, follower, motor }, config) {
    super({ motor, data: { followee, follower, speed: config?.speed ?? 1 } }, { autoStart: false });
    this.followee = followee;
  }
  activate() {
    super.activate();
    this.followee.onChange(this.listener);
  }
  deactivate() {
    this.followee.removeChangeListener(this.listener);
    super.deactivate();
  }
  refresh({ data: { follower, followee, speed }, motor, refresher }) {
    const [x4, y, z2] = followee.position;
    const [fx, fy, fz] = follower.position;
    const dx = x4 - fx, dy2 = y - fy, dz = z2 - fz;
    const dist2 = Math.sqrt(dx * dx + dy2 * dy2 + dz * dz);
    if (dist2 < 0.1) {
      follower.moveTo(x4, y, z2);
      motor.stopUpdate(refresher);
    } else {
      const moveSpeed = Math.min(dist2, speed * dist2) / dist2;
      follower.moveBy(dx * moveSpeed, dy2 * moveSpeed, dz * moveSpeed);
    }
  }
}

