// src/world/sprite/update/MediaUpdater.ts
class MediaUpdater extends Updater {
  #savedMediaInfo = new Map;
  motor;
  constructor({ engine, motor }) {
    super(new UpdateRegistry((ids) => {
      if (!this.elems) {
        return;
      }
      ids.forEach((id) => this.removeMedia(id));
      engine.updateTextures(ids, this.elems).then((mediaInfos) => mediaInfos.forEach((mediaInfo) => {
        if (mediaInfo.isVideo) {
          motor.scheduleUpdate(mediaInfo, undefined, mediaInfo.refreshRate);
          this.#savedMediaInfo.set(mediaInfo.id, mediaInfo);
        } else {
          mediaInfo.dispose();
        }
      }));
    }, motor));
    this.motor = motor;
  }
  removeMedia(id) {
    const mediaInfo = this.#savedMediaInfo.get(id);
    if (mediaInfo) {
      this.motor.stopUpdate(mediaInfo);
      mediaInfo.dispose();
      this.#savedMediaInfo.delete(id);
    }
  }
  dispose() {
    this.#savedMediaInfo.forEach((mediaInfo) => this.removeMedia(mediaInfo.id));
  }
}

// src/world/sprite/aux/Accumulator.ts
class Accumulator extends AuxiliaryHolder {
  constructor() {
    super(...arguments);
  }
  indices = [];
  newElemsListener = new Set;
  pool = new SlotPool;
  at(id) {
    const slot = this.indices[id];
    return slot?.elems.at(slot.index);
  }
  get length() {
    return this.indices.length;
  }
  activate() {
    super.activate();
    this.informFullUpdate();
  }
  deactivate() {
    this.informFullUpdate();
    this.clear();
    super.deactivate();
  }
  informFullUpdate() {
    this.indices.forEach((slot) => {
      if (slot.id !== undefined) {
        this.informUpdate?.(slot.id);
      }
    });
  }
  clear() {
    this.indices.forEach((slot) => this.pool.recycle(slot));
    this.indices.length = 0;
  }
  add(...elemsList) {
    elemsList.forEach((elems) => {
      const indexMaping = [];
      if (elems.informUpdate) {
        elems.informUpdate = (index, type) => {
          const elem = elems.at(index);
          let id = indexMaping[index];
          if (id === undefined) {
            if (!elem) {
              return;
            }
            id = this.indices.length;
            indexMaping[index] = id;
            this.informUpdate?.(id);
            this.indices.push(this.pool.create(elems, index, id));
            this.onSizeChange();
            return;
          } else {
            if (!elem) {
              indexMaping[index] = undefined;
              const slot = this.indices[id];
              this.pool.recycle(slot);
              const lastSlotId = this.indices.length - 1;
              if (id !== lastSlotId) {
                this.indices[id] = this.indices[lastSlotId];
                this.indices[id].id = id;
                this.informUpdate?.(lastSlotId);
              }
              this.indices.pop();
              this.informUpdate?.(id);
              this.onSizeChange();
              return;
            }
          }
          this.informUpdate?.(id, type);
        };
      } else {
        throw new Error("informUpdate must be defined");
      }
    });
  }
  onSizeChange() {
    this.newElemsListener.forEach((listener) => listener(this));
  }
  addNewElemsListener(listener) {
    this.newElemsListener.add(listener);
  }
}

class SlotPool extends f2 {
  constructor() {
    super((slot, elems, index, id) => {
      if (!slot) {
        return { elems, index, id };
      }
      slot.elems = elems;
      slot.index = index;
      slot.id = id;
      return slot;
    });
  }
}

