// src/world/aux/FollowAuxiliary.ts
class FollowAuxiliary extends E2 {
  followee;
  config;
  listener = (dx, dy2, dz) => {
    if (dx && this.config.followX || dy2 && this.config.followY || dz && this.config.followZ) {
      this.start();
    }
  };
  constructor({ followee, follower, motor }, config) {
    super({ motor, data: { followee, follower } }, { autoStart: false });
    this.followee = followee;
    this.config = {
      followX: config?.followX ?? true,
      followY: config?.followY ?? true,
      followZ: config?.followZ ?? true,
      speed: config?.speed ?? 1
    };
  }
  activate() {
    super.activate();
    this.followee.onChange(this.listener);
    this.start();
  }
  deactivate() {
    this.followee.removeChangeListener(this.listener);
    super.deactivate();
  }
  refresh({ data, stopUpdate }) {
    const { followX, followY, followZ, speed } = this.config;
    const x4 = followX ? data.followee.position[0] : data.follower.position[0];
    const y = followY ? data.followee.position[1] : data.follower.position[1];
    const z2 = followZ ? data.followee.position[2] : data.follower.position[2];
    data.follower.gotoPos(x4, y, z2, speed);
    if (data.followee.position[0] === data.follower.position[0] && data.followee.position[1] === data.follower.position[1] && data.followee.position[2] === data.follower.position[2]) {
      stopUpdate();
    }
  }
}

// src/world/collision/DisplayBox.ts
class DisplayBox {
  sprites;
  constructor(box, imageId, insideImageId) {
    if (!box.disabled) {
      const cX = (box.left + box.right) / 2;
      const cY = (box.top + box.bottom) / 2;
      const cZ = (box.near + box.far) / 2;
      const groundScale = [box.right - box.left, 2, box.near - box.far];
      const sideScale = [2, box.top - box.bottom, box.near - box.far];
      const faceScale = [box.right - box.left, box.top - box.bottom, 2];
      const outside = [
        Matrix_default.create().translate(cX, box.bottom, cZ).scale(...groundScale).scale(0.5).rotateX(Math.PI / 2),
        Matrix_default.create().translate(cX, box.top, cZ).scale(...groundScale).scale(0.5).rotateX(-Math.PI / 2),
        Matrix_default.create().translate(box.left, cY, cZ).scale(...sideScale).scale(0.5).rotateY(-Math.PI / 2),
        Matrix_default.create().translate(box.right, cY, cZ).scale(...sideScale).scale(0.5).rotateY(Math.PI / 2),
        Matrix_default.create().translate(cX, cY, box.near).scale(...faceScale).scale(0.5).rotateY(0),
        Matrix_default.create().translate(cX, cY, box.far).scale(...faceScale).scale(0.5).rotateY(Math.PI)
      ].map((transform) => ({ imageId, transform }));
      const inside = !insideImageId ? [] : [
        Matrix_default.create().translate(cX, box.bottom, cZ).scale(...groundScale).scale(0.5).rotateX(-Math.PI / 2),
        Matrix_default.create().translate(cX, box.top, cZ).scale(...groundScale).scale(0.5).rotateX(+Math.PI / 2),
        Matrix_default.create().translate(box.left, cY, cZ).scale(...sideScale).scale(0.5).rotateY(+Math.PI / 2),
        Matrix_default.create().translate(box.right, cY, cZ).scale(...sideScale).scale(0.5).rotateY(-Math.PI / 2),
        Matrix_default.create().translate(cX, cY, box.near).scale(...faceScale).scale(0.5).rotateY(Math.PI),
        Matrix_default.create().translate(cX, cY, box.far).scale(...faceScale).scale(0.5).rotateY(0)
      ].map((transform) => ({ imageId: insideImageId, transform }));
      this.sprites = [...inside, ...outside];
    } else {
      this.sprites = [];
    }
  }
  get length() {
    return this.sprites.length;
  }
  at(index) {
    return this.sprites.at(index);
  }
  informUpdate(_id, _type) {
  }
}

// src/world/collision/Box.ts
var NULLBOX = {
  top: 0,
  bottom: 0,
  left: 0,
  right: 0,
  near: 0,
  far: 0,
  disabled: false
};

// src/world/collision/CollisionBox.ts
class CollisionBox {
  box;
  position;
  constructor(box, position) {
    this.box = box;
    this.position = position;
  }
  collideWith(box) {
    return this.right > box.left && box.right > this.left && this.top > box.bottom && box.top > this.bottom && this.near > box.far && box.near > this.far;
  }
  gotoPosition(pos) {
    this.position[0] = pos[0];
    this.position[1] = pos[1];
    this.position[2] = pos[2];
  }
  get top() {
    return this.box.top + this.position[1];
  }
  get bottom() {
    return this.box.bottom + this.position[1];
  }
  get left() {
    return this.box.left + this.position[0];
  }
  get right() {
    return this.box.right + this.position[0];
  }
  get near() {
    return this.box.near + this.position[2];
  }
  get far() {
    return this.box.far + this.position[2];
  }
}

// src/world/collision/CollisionDetector.ts
class CollisionDetector {
  collisionBox;
  heroCollisionBox;
  collide = false;
  config;
  listener;
  disabled;
  constructor({ blockerBox, blockerPosition, heroBox = NULLBOX, listener = {} }, config = {}) {
    this.collisionBox = new CollisionBox(blockerBox, blockerPosition);
    this.heroCollisionBox = new CollisionBox(heroBox, [0, 0, 0]);
    this.listener = listener;
    this.config = { shouldBlock: config.shouldBlock ?? false };
    this.disabled = blockerBox.disabled;
  }
  isBlocked(to) {
    if (this.disabled) {
      return false;
    }
    this.heroCollisionBox.gotoPosition(to);
    const collide = this.heroCollisionBox.collideWith(this.collisionBox);
    if (collide !== this.collide) {
      this.collide = collide;
      this.listener.onBlockChange?.(this.collide);
      if (this.collide) {
        this.listener.onEnter?.();
      } else {
        this.listener.onLeave?.();
      }
    }
    return this.config.shouldBlock ? collide : false;
  }
}

// src/world/collision/CollisionDetectors.ts
class CollisionDetectors {
  detectors;
  constructor(detectors) {
    this.detectors = detectors;
  }
  isBlocked(to, from) {
    const { length: length4 } = this.detectors;
    for (let i = 0;i < length4; i++) {
      if (this.detectors.at(i)?.isBlocked(to, from)) {
        return true;
      }
    }
    return false;
  }
}

